import Link from "next/link";
import CheckoutForm from './components/CheckoutForm';

const App = () => (
    <div>
        <h1>Hello World</h1>
        <FormRow>
            <CheckoutForm />
        </FormRow>
        <Link href="/success">
        <button>Go to Success</button>
        </Link>
    </div>
);

export default App;
